    <div>
      <h1>Welcome to Our Wedding Website!</h1>
      <p>We're so excited to celebrate with you on [Date] at [Location].</p>
      <Link to="/RSVP">RSVP Here</Link>
      {/* Add more content as needed */}
    </div>
  );
}

export default HomePage;
